package com.seluhadu.shchat.models;public class FileMessage extends BaseMessage {    private User sender;    private String userId;    private String url;    private String name;    private int size;    private String type;    private String data;    private String customType;    public FileMessage() {    }    public FileMessage(User sender, String userId, String url, String name, int size, String type, String data, String customType) {        this.sender = sender;        this.userId = userId;        this.url = url;        this.name = name;        this.size = size;        this.type = type;        this.data = data;        this.customType = customType;    }    public User getSender() {        return sender;    }    public void setSender(User sender) {        this.sender = sender;    }    @Override    public String getUserId() {        return userId;    }    @Override    public void setUserId(String userId) {        this.userId = userId;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public int getSize() {        return size;    }    public void setSize(int size) {        this.size = size;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    public String getCustomType() {        return customType;    }    public void setCustomType(String customType) {        this.customType = customType;    }}